        /**
         * <p>A summarized list of different types of messages. </p><h3>Overview</h3><p> A message popover is used to display a summarized list of different types of messages (errors, warnings, success and information). It provides a handy and systemized way to navigate and explore details for every message. It also exposes an event <a class="jsdoclink scrollToMethod" target="_self" href="#/api/sap.m.MessagePopover/methods/activeTitlePress" data-sap-ui-target="sap.m.MessagePopover/methods/activeTitlePress">sap.m.MessagePopover#activeTitlePress</a>, which can be used for navigation from a message to the source of the issue. </p><h4>Notes:</h4><p> <ul> <li> Messages can have descriptions pre-formatted with HTML markup. In this case, the <code>markupDescription</code> has to be set to <code>true</code>.</li> <li> If the message cannot be fully displayed or includes a long description, the message popover provides navigation to the detailed description.</li> </ul> </p><h3>Structure</h3><p> The message popover stores all messages in an aggregation of type <a class="jsdoclink scrollToMethod" target="_self" href="#/api/sap.m.MessageItem" data-sap-ui-target="MessageItem">sap.m.MessageItem</a> named <code>items</code>.</p><p>A set of properties determines how the items are rendered: <ul> <li> counter - An integer that is used to indicate the number of errors for each type </li> <li> type - The type of message </li> <li> title/subtitle - The title and subtitle of the message</li> <li> description - The long text description of the message</li> <li> activeTitle - Determines whether the title of the item is interactive</li> </ul> </p><h3>Usage</h3><p> With the message concept, MessagePopover provides a way to centrally manage messages and show them to the user without additional work for the developer. The message popover is triggered from a messaging button in the footer toolbar. If an error has occurred at any validation point, the total number of messages should be incremented, but the user's work shouldn't be interrupted. Navigation between the message item and the source of the error can be created, if needed by the application. This can be done by setting the <code>activeTitle</code> property to true and providing a handler for the <code>activeTitlePress</code> event. In addition, you can achieve the same functionality inside a different container using the sap.m.MessageView control. </p><h3>Responsive Behavior</h3><p> On mobile phones, the message popover is automatically shown in full screen mode.<br> On desktop and tablet, the message popover opens in a popover.<br> On desktop the opened popover is resizable if it is placed in a <a class="jsdoclink scrollToMethod" target="_self" href="#/api/sap.m.Toolbar" data-sap-ui-target="Toolbar">sap.m.Toolbar</a>, <a class="jsdoclink scrollToMethod" target="_self" href="#/api/sap.m.Bar" data-sap-ui-target="Bar">sap.m.Bar</a> or used in <a class="jsdoclink scrollToMethod" target="_self" href="#/api/sap.f.semantic.SemanticPage" data-sap-ui-target="SemanticPage">sap.f.semantic.SemanticPage</a></p>
         */
