        /**
         * <p>A single-field input control that enables the users to fill time related input fields.</p><h3>Overview</h3><p>The <code>TimePicker</code> control enables the users to fill time related input fields using touch, mouse, or keyboard input.</p><h3>Usage</h3><p>Use this control if you want the user to select a time. If you want the user to select a duration (1 hour), use the <a class="jsdoclink scrollToMethod" target="_self" href="#/api/sap.m.Select" data-sap-ui-target="Select">sap.m.Select</a> control instead.</p><p>The user can enter a date by:</p><p><ul><li>Using the <code>TimePicker</code> dropdown that opens in a popup</li> <li>Typing it in directly in the input field</li></ul></p><p>On app level, there are two options to provide value for the <code>TimePicker</code> - as a string to the <code>value</code> property or as a JavaScript Date object to the <code>dateValue</code> property (only one of these properties should be used at a time):</p><p><ul><li>Use the <code>value</code> property if you want to bind the <code>TimePicker</code> to a model using the <code>sap.ui.model.type.Time</code></li> <li>Use the <code>value</code> property if the date is provided as a string from the backend or inside the app (for example, as ABAP type DATS field)</li> <li>Use the <code>dateValue</code> property if the date is already provided as a JavaScript Date object or you want to work with a JavaScript Date object. Use <code>dateValue</code> as a helper property to easily obtain the hours, minutes and seconds of the chosen time. Although possible to bind it, the recommendation is to not to do it. When binding is needed, use <code>value</code> property instead</li></ul></p><h3>Formatting</h3><p>All formatting and parsing of values from and to strings is done using the <a class="jsdoclink scrollToMethod" target="_self" href="#/api/sap.ui.core.format.DateFormat" data-sap-ui-target="DateFormat">sap.ui.core.format.DateFormat</a>. If a value is entered by typing it into the input field, it must fit to the used time format and locale.</p><p>Supported format options are pattern-based on Unicode LDML Date Format notation. See <a target="blank" href="http://unicode.org/reports/tr35/#Date_Field_Symbol_Table">http://unicode.org/reports/tr35/#Date_Field_Symbol_Table</a>
        <img src="./resources/sap/ui/documentation/sdk/images/link-external.png" 
        title="Information published on non SAP site" class="sapUISDKExternalLink"/></p><p>A time format must be specified, otherwise the default "HH:mm:ss a" will be used. For example, if the <code>valueFormat</code> is "HH-mm-ss a", the <code>displayFormat</code> is "HH:mm:ss a", and the used locale is English, a valid value string is "10-30-15 AM", which leads to an output of "10:30:15 AM".</p><p>If no placeholder is set to the <code>TimePicker</code>, the used <code>displayFormat</code> is displayed as a placeholder. If another placeholder is needed, it must be set.</p><p><b>Note:</b> If the string does NOT match the <code>displayFormat</code> (from user input) or the <code>valueFormat</code> (on app level), the <a class="jsdoclink scrollToMethod" target="_self" href="#/api/sap.ui.core.format.DateFormat" data-sap-ui-target="DateFormat">sap.ui.core.format.DateFormat</a> makes an attempt to parse it based on the locale settings. For more information, see the respective documentation in the API Reference.</p><h3>Responsive behavior</h3><p>The <code>TimePicker</code> is responsive and fully adapts to all device types. For larger screens, such as tablet or desktop, it opens as a popover. For mobile devices, it opens in full screen.</p>
         */
