        /**
         * <p>Enables users to accomplish a single goal which consists of multiple dependable sub-tasks. </p><h3>Overview</h3><p> The sap.m.Wizard helps users complete a complex and unfamiliar task by dividing it into sections and guiding the user through it. The wizard has two main areas - a navigation area at the top showing the step sequence and a content area below it. </p><h3>Structure</h3><h4>Navigation Area</h4><p> The top most area of the wizard is occupied by the navigation area. It shows the sequence of <a class="jsdoclink scrollToMethod" target="_self" href="#/api/sap.m.WizardStep" data-sap-ui-target="WizardStep">wizard steps</a>. <ul> <li>The minimum number of steps is 3 and the maximum is 8 and are stored in the <code>steps</code> aggregation.</li> <li>Steps can be branching depending on choices the user made in their input - this is set by the <code>enableBranching</code> property. </li> <li>Steps can have different visual representations - numbers or icons. You can add labels for better readability </li> </ul> </p><h4>Content</h4><p> The content occupies the main part of the page. It can hold any type of input controls. The content is kept in <a class="jsdoclink scrollToMethod" target="_self" href="#/api/sap.m.WizardStep" data-sap-ui-target="WizardStep">wizard steps</a>. </p><h4>Next Step Button</h4><p> The next step button is displayed below the content. It can be hidden by setting <code>showNextButton</code> to <code>false</code> and displayed, for example, only after the user has filled all mandatory fields. </p><h3>Usage</h3><h4>When to use:</h4><p> When the user has to accomplish a long or unfamiliar task. </p><h4>When not to use:</h4><p> When the user has to accomplish a routine task that is clear and familiar. When the task has only two steps or less. </p><h3>Responsive Behavior</h3><p> On mobile devices the steps in the StepNavigator are grouped together and overlap. Tapping on them will show a popover to select the step to navigate to.</p>
         */
